    <script>
		// 위에 const imageData =  {"width": 400, "height": 300, "pixels": [[139, 69, 19], [139, 69, 19], [139, 69, 19], [139, 69, 19], ... 이런식으로 정의되어있음.
		// 위 코드는 생략
		
        // 이미지를 확대할 배율

        const scaleFactor = 2;
        let particleRandX = new Array(imageData.width * imageData.height);
        let particleRandY = new Array(imageData.width * imageData.height);


        let currentTemp = new Array(imageData.height).fill().map(() => new Array(imageData.width).fill(0));
        let nextTemp = new Array(imageData.height).fill().map(() => new Array(imageData.width).fill(0));
		
        const dx = [0, 1, 0, -1]; // 주변 픽셀을 체크하기 위한 방향 배열
        const dy = [-1, 0, 1, 0];

		const conductivity = {"air": 0.025, "water": 0.6, "floor": 1.3, "smoke": 0.025, "wood": 0.12}; // 각 재료의 열전도율
        const specificHeat = {"air": 1.005, "water": 4.186, "floor": 0.88, "smoke": 1.005, "wood": 1.7}; // 비열
        const density = {"air": 1.225, "water": 1000, "floor": 2400, "smoke": 1.225, "wood": 600}; // 밀도


        function setup() {
            createCanvas(imageData.width * scaleFactor, imageData.height * scaleFactor);
			drawBackground(); // 초기 배경 그리기
            frameRate(10); // 1초에 10번 업데이트
            loop();  // 애니메이션을 무한 반복으로 설정
			// 초기 온도 설정 
			// 화원 255,0,0 인 부분은 1000도로 유지
			
            // 픽셀 색상이 빨간색인 경우
            for (let y = 0; y < imageData.height; y++) {
                for (let x = 0; x < imageData.width; x++) {
                    let index = y * imageData.width + x;
                    let pix = imageData.pixels[index];					
					if (pix[0] === 255 && pix[1] === 0 && pix[2] === 0) {
						currentTemp[y][x] = 1000; // 해당 위치를 1000도로 설정
					}
                }
            }

        }
		
		function getMaterialFromColor(color) {
			// Logic to determine the material based on color / 색상을 기준으로 소재를 결정하는 로직
			if (color[0] === 139 && color[1] === 112 && color[2] === 12) return "soil";
			else if (color[0] === 139 && color[1] === 69 && color[2] === 19) return "wood"; 
			else if (color[0] === 173 && color[1] === 216 && color[2] === 230) return "water"; // Light blue color represents "water" / 연한 파란색(173, 216, 230)일 경우 "water"를 반환
			else if (color[0] === 211 && color[1] === 211 && color[2] === 211) return "floor"; // Light gray color represents "floor" / 회색(211, 211, 211)일 경우 "floor"를 반환
			else if (color[0] === 105 && color[1] === 105 && color[2] === 105) return "smoke"; // Dark gray color represents "smoke" / 어두운 회색(105, 105, 105)일 경우 "smoke"를 반환
			else return "air"; // Any other color represents "air" / 그 외의 색상일 경우 "air"를 반환
		}

        function draw() {
            updateTemperatures();
			drawBackground(); // 초기 배경 그리기
            particleRandomMoving();
            drawParticles();
        }
				
		function updateTemperatures() {
			// Loop through each pixel in the image, excluding the border pixels
			// 이미지의 각 픽셀을 순회합니다. 경계 픽셀은 제외합니다.
			for (let y = 1; y < imageData.height - 1; y++) {
				for (let x = 1; x < imageData.width - 1; x++) {
					let index = y * imageData.width + x;
					let pix = imageData.pixels[index];
					// Determine the material of the current pixel based on its color
					// 현재 픽셀의 색상을 기반으로 소재를 결정합니다.
					let material = getMaterialFromColor(pix);
					let sum = 0;
					let count = 0;

					// Sum the temperatures of the adjacent pixels
					// 인접한 픽셀의 온도를 합산합니다.
					for (let i = 0; i < 4; i++) {
						let nx = x + dx[i];
						let ny = y + dy[i];
						sum += currentTemp[ny][nx];
						count++;
					}

					// Calculate the new temperature for the current pixel
					// 현재 픽셀의 새로운 온도를 계산합니다.
					nextTemp[y][x] = currentTemp[y][x] + (sum - count * currentTemp[y][x]) * conductivity[material] / (density[material] * specificHeat[material]);
				}
			}

			// Swap the current and next temperature grids
			// 현재와 다음 온도 그리드를 교환합니다.
			let temp = currentTemp;
			currentTemp = nextTemp;
			nextTemp = temp;
		}


        function drawBackground() {
            for (let y = 0; y < imageData.height; y++) {
                for (let x = 0; x < imageData.width; x++) {
                    let index = y * imageData.width + x;
                    let pix = imageData.pixels[index];
                    fill(pix[0], pix[1], pix[2]);
                    noStroke();
                    rect(x * scaleFactor, y * scaleFactor, scaleFactor, scaleFactor);
                }
            }
        } 


		function particleRandomMoving() {
			for (let y = 0; y < imageData.height; y++) {
				for (let x = 0; x < imageData.width; x++) {
					let index = y * imageData.width + x;
					let pix = imageData.pixels[index];
					let temp = currentTemp[y][x]; // 해당 위치의 온도를 가져옴

					// 온도에 따른 움직임 범위 결정
					let movementFactor = 1;
					if (temp <= 0) movementFactor = 0;
					else if (temp < 10) movementFactor = 1;
					else if (temp < 15) movementFactor = 2;
					else if (temp < 20) movementFactor = 3;
					else if (temp < 25) movementFactor = 4;
					else if (temp < 30) movementFactor = 5;
					else if (temp < 35) movementFactor = 6;
					else if (temp < 40) movementFactor = 7;
					else if (temp < 50) movementFactor = 8;
					else if (temp < 70) movementFactor = 9;
					else if (temp < 100) movementFactor = 10;
					else if (temp < 200) movementFactor = 11;
					else if (temp < 500) movementFactor = 12;
					else if (temp < 1000) movementFactor = 13;
					else movementFactor = 14;


					particleRandX[index] = random(-0.5, 0.5) * scaleFactor * movementFactor;
					particleRandY[index] = random(-0.5, 0.5) * scaleFactor * movementFactor;
				}
			}
		}


		function drawParticles() {
			let particleSize = scaleFactor; // 파티클의 크기를 scaleFactor의 1배로 증가
			let blockSize = 10; // 블록의 크기를 5x5로 설정

			for (let y = 0; y < imageData.height; y += blockSize) {
				for (let x = 0; x < imageData.width; x += blockSize) {
					// 블록의 중앙 좌표를 계산
					let centerX = x + blockSize / 2;
					let centerY = y + blockSize / 2;

					// 중앙 좌표가 이미지 경계를 넘지 않도록 처리
					centerX = Math.min(centerX, imageData.width - 1);
					centerY = Math.min(centerY, imageData.height - 1);

					let index = (centerY * imageData.width) + centerX;
					let temp = currentTemp[Math.floor(centerY)][Math.floor(centerX)]; // 해당 위치의 온도를 가져옴
					let color; // 온도에 따른 색상

					// 온도에 따른 색상 설정
					if (temp <= 0) color = [0, 0, 255]; // 파란색
					else if (temp < 10) color = [70, 30, 200]; // Blue to red transition
					else if (temp < 15) color = [100, 60, 200]; // Blue to red transition
					else if (temp < 20) color = [130, 90, 200]; // Blue to red transition
					else if (temp < 25) color = [160, 120, 200]; // Blue to red transition
					else if (temp < 30) color = [190, 150, 200]; // Blue to red transition
					else if (temp < 35) color = [220, 180, 200]; // Blue to red transition
					else if (temp < 40) color = [250, 210, 200]; // Blue to red transition
					else if (temp < 50) color = [255, 180, 180]; // Light red
					else if (temp < 70) color = [255, 140, 140]; // Light red
					else if (temp < 100) color = [255, 100, 100]; // Light red
					else if (temp < 200) color = [255, 60, 60]; // Light red
					else if (temp < 500) color = [255, 30, 30]; // Red
					else if (temp < 1000) color = [255, 0, 0]; // Red
					else color = [255, 0, 0]; // Red


					fill(color[0], color[1], color[2]); // 설정한 색상으로 채우기
					noStroke();
					ellipse(
						(centerX * scaleFactor) + particleRandX[index] + particleSize / 2,
						(centerY * scaleFactor) + particleRandY[index] + particleSize / 2,
						particleSize * 3, particleSize * 3 // 파티클 크기를 기존보다 크게 조정
					);
				}
			}
		}

    </script>
